import React from 'react';
import Wallet from '../components/Wallet';
import '../styles/Wallets.css';
import windows from '../media/images/windows.png';
import apple from '../media/images/apple.png';
import android from '../media/images/android.png';
import world from '../media/images/world.png';
import github from '../media/images/github.png';

const Wallets = () => {
    return (
        <div className="wallet__container">
            <div className="wallet__header">Wallets</div>

            <div className="wallet__box">
                <Wallet name='Windows 32-Bit' message='Download' link='' image={windows} alt='windows logo'/>
                <Wallet name='Windows 64-Bit' message='Download' link='' image={windows} alt='windows logo'/>
                <Wallet name='COINiD' message='Google Play' link='' image={android} alt='android logo'/>
                <Wallet name='COINiD' message='App Store' link='' image={apple} alt='apple logo'/>
                <Wallet name='macOS' message='Download' link='' image={apple} alt='apple logo'/>
                <Wallet name='JSWallet' message='Visit Web Wallet' link='' image={world} alt='globe'/>
                <Wallet name='Other Builds' message='Visit GitHub' link='' image={github} alt='github logo'/>
            </div>
        </div>
    )
}

export default Wallets
